const adminService = {
	getDashboardStats: async () => {
		const { count: usersCount } = await supabase.from("profiles").select("*", {
			count: "exact",
			head: true
		});
		const { count: activeUsersCount } = await supabase.from("profiles").select("*", {
			count: "exact",
			head: true
		});
		const { count: proposalsCount } = await supabase.from("proposals").select("*", {
			count: "exact",
			head: true
		});
		const { count: acceptedProposalsCount } = await supabase.from("proposals").select("*", {
			count: "exact",
			head: true
		}).eq("status", "Aceita");
		const { data: creditsData } = await supabase.from("proposal_credits").select("monthly_used");
		const totalCreditsUsed = creditsData?.reduce((acc, curr) => acc + curr.monthly_used, 0) || 0;
		return {
			usersCount: usersCount || 0,
			activeUsersCount: activeUsersCount || 0,
			proposalsCount: proposalsCount || 0,
			acceptedProposalsCount: acceptedProposalsCount || 0,
			totalCreditsUsed
		};
	},
	getUsers: async () => {
		const { data, error } = await supabase.from("profiles").select(`
        *,
        credits:proposal_credits(*),
        subscription:subscriptions(*)
      `).order("created_at", { ascending: false });
		if (error) throw error;
		return data;
	},
	updateUserRole: async (userId, role) => {
		const { error } = await supabase.from("profiles").update({ role }).eq("id", userId);
		if (error) throw error;
		await adminService.logAction("UPDATE_ROLE", `Changed user role to ${role}`, userId);
	},
	adjustCredits: async (userId, monthlyDelta, extraDelta, reason) => {
		const { data: { user } } = await supabase.auth.getUser();
		if (!user) throw new Error("Admin not authenticated");
		const { error } = await supabase.rpc("admin_adjust_credits", {
			p_user_id: userId,
			p_monthly_delta: monthlyDelta,
			p_extra_delta: extraDelta,
			p_admin_id: user.id,
			p_reason: reason
		});
		if (error) throw error;
	},
	logAction: async (actionType, description, targetId, details) => {
		const { data: { user } } = await supabase.auth.getUser();
		if (!user) return;
		await supabase.from("admin_logs").insert({
			admin_id: user.id,
			action_type: actionType,
			description,
			target_id: targetId,
			details
		});
	},
	getAllProposals: async () => {
		const { data, error } = await supabase.from("proposals").select("*, property:properties(name), profile:profiles(name)").order("created_at", { ascending: false }).limit(100);
		if (error) throw error;
		return data;
	},
	getLogs: async () => {
		const { data, error } = await supabase.from("admin_logs").select("*").order("created_at", { ascending: false }).limit(50);
		if (error) throw error;
		return data;
	}
};
